import axios from 'axios';

console.log("entry"); 
async function fetchData(){
    // access data directly in json format not in promise
    const userData= await axios.get("https://randomuser.me/api/").data
    // .data.results[0];  
    console.log(userData);
}
fetchData(); 

export default fetchData;
